import React from 'react';
import Tilt from 'react-parallax-tilt';
import logo from './logo.png'

const Logo = () => {
	return(
		<div className= 'ma3 mt0 pa3' >
		 <Tilt className="parallax-effect-img"
          tiltMaxAngleX={3}
          tiltMaxAngleY={3}
          perspective={900}
          transitionSpeed={1000}
          scale={1.0}
          gyroscope={true}>
           <div className='br2 shadow-2'style={{ height: '180px', width: '180px', background: 'linear-gradient(to right, #ba5370, #f4e2d8)' }}>
             <img style={{ paddingTop : '5px' }}src={logo}></img>
           </div>
         </Tilt>
		</div>
		);
};

export default Logo;
